import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { useVideo } from '../context/VideoContext';
import { 
  Search, 
  Play, 
  Clock, 
  Sparkles,
  Send,
  Paperclip,
  ChevronDown,
  Star,
  Heart,
  X
} from 'lucide-react';
import VideoPlayer from './VideoPlayer';

const AIVideoStudio = () => {
  const { videos, generateVideo, loading, fetchVideos } = useVideo();
  const [searchTerm, setSearchTerm] = useState('');
  const [prompt, setPrompt] = useState('');
  const [selectedModel, setSelectedModel] = useState('Runway Gen-4 Turbo');
  const [showLovableBanner, setShowLovableBanner] = useState(true);

  useEffect(() => {
    fetchVideos();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!prompt.trim()) return;

    try {
      await generateVideo(prompt);
      setPrompt('');
    } catch (error) {
      console.error('Error generating video:', error);
    }
  };

  const filteredVideos = videos.filter(video => 
    video.prompt.toLowerCase().includes(searchTerm.toLowerCase()) ||
    (video.title && video.title.toLowerCase().includes(searchTerm.toLowerCase()))
  );

  const formatTimeAgo = (date) => {
    const now = new Date();
    const diffInHours = Math.floor((now - new Date(date)) / (1000 * 60 * 60));

    if (diffInHours < 1) return 'Just now';
    if (diffInHours === 1) return '1 hour ago';
    if (diffInHours < 24) return `${diffInHours} hours ago`;

    const diffInDays = Math.floor(diffInHours / 24);
    if (diffInDays === 1) return '1 day ago';
    return `${diffInDays} days ago`;
  };

  return (
    <div className="h-screen flex flex-col bg-gray-50">
      {/* Header */}
      <motion.header
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="bg-white/80 backdrop-blur border-b border-gray-200 px-6 py-4 flex items-center justify-between"
      >
        {/* Logo and Title */}
        <div className="flex items-center space-x-3">
          <div className="w-10 h-10 bg-gradient-to-br from-primary-500 to-primary-600 rounded-lg flex items-center justify-center shadow-glow">
            <Star className="h-6 w-6 text-white" />
          </div>
          <h1 className="text-xl font-bold text-gray-900">AI Video Studio</h1>
        </div>

        {/* Model Selector and Right side text */}
        <div className="flex items-center space-x-4">
          {/* Model Selection */}
          <div className="flex items-center space-x-2">
            <span className="text-sm text-gray-600">Model:</span>
            <div className="relative">
              <select
                value={selectedModel}
                onChange={(e) => setSelectedModel(e.target.value)}
                className="appearance-none bg-white border border-gray-200 rounded-lg px-3 py-1.5 pr-8 text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
              >
                <option value="Runway Gen-4 Turbo">Runway Gen-4 Turbo</option>
                <option value="Runway Gen-3">Runway Gen-3</option>
                <option value="Veo3">Veo3</option>
              </select>
              <ChevronDown className="absolute right-2 top-1/2 transform -translate-y-1/2 h-3 w-3 text-gray-400 pointer-events-none" />
            </div>
          </div>

          <div className="flex items-center space-x-2 text-gray-600">
            <span className="text-sm">Next-gen AI video creation</span>
            <Sparkles className="h-4 w-4 text-primary-500" />
          </div>
        </div>
      </motion.header>

      {/* Main Content */}
      <div className="flex-1 flex overflow-hidden">
        {/* Left Sidebar */}
        <motion.div
          initial={{ opacity: 0, x: -20 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.6, delay: 0.1 }}
          className="w-80 bg-white/60 backdrop-blur border-r border-gray-200 flex flex-col"
        >
          {/* Search Bar */}
          <div className="p-4 border-b border-gray-200">
            <div className="relative">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 h-4 w-4 text-gray-400" />
              <input
                type="text"
                placeholder="Search videos..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-10 pr-4 py-2 bg-white border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent text-sm"
              />
            </div>
          </div>

          {/* Video List */}
          <div className="flex-1 overflow-y-auto p-4 space-y-3">
            {filteredVideos.map((video, index) => (
              <motion.div
                key={video.videoId}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.4, delay: index * 0.1 }}
                className="bg-white rounded-lg p-3 hover:shadow-medium transition-shadow cursor-pointer border border-gray-100"
              >
                {/* Video Thumbnail */}
                <div className="relative aspect-video bg-gray-200 rounded-lg mb-3 overflow-hidden">
                  {video.status === 'completed' && video.videoUrl ? (
                    <VideoPlayer videoUrl={video.videoUrl} className="w-full h-full" />
                  ) : (
                    <div className="w-full h-full flex items-center justify-center">
                      <Play className="h-8 w-8 text-gray-400" />
                    </div>
                  )}

                  {/* Duration Badge */}
                  <div className="absolute bottom-2 right-2 bg-black/80 text-white text-xs px-2 py-1 rounded">
                    {video.duration}s
                  </div>
                </div>

                {/* Video Info */}
                <div>
                  <h3 className="font-medium text-gray-900 text-sm mb-1 line-clamp-2">
                    {video.title || video.prompt.split(' ').slice(0, 8).join(' ') + '...'}
                  </h3>

                  <div className="flex items-center justify-between text-xs text-gray-500">
                    <span>{formatTimeAgo(video.createdAt)}</span>
                    <span className="bg-primary-100 text-primary-700 px-2 py-1 rounded-full">
                      {selectedModel.split(' ')[0]} {selectedModel.split(' ')[1]}
                    </span>
                  </div>
                </div>
              </motion.div>
            ))}

            {filteredVideos.length === 0 && (
              <div className="text-center py-8">
                <div className="w-16 h-16 bg-gray-200 rounded-full flex items-center justify-center mx-auto mb-3">
                  <Play className="h-8 w-8 text-gray-400" />
                </div>
                <p className="text-gray-500 text-sm">
                  {searchTerm ? 'No videos found' : 'No videos yet'}
                </p>
              </div>
            )}
          </div>
        </motion.div>

        {/* Main Content Area */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="flex-1 relative overflow-hidden"
        >
          {/* Futuristic Background */}
          <div className="absolute inset-0 bg-gradient-to-br from-gray-50 via-purple-50 to-pink-50">
            {/* Animated geometric shapes */}
            <div className="absolute top-20 left-20 w-32 h-32 border-2 border-purple-300 rounded-lg opacity-20 animate-pulse"></div>
            <div className="absolute top-40 right-32 w-24 h-24 bg-pink-200 rounded-full opacity-30 animate-bounce"></div>
            <div className="absolute bottom-32 left-1/3 w-40 h-40 border-2 border-pink-300 rounded-full opacity-20 animate-pulse"></div>

            {/* Central platform */}
            <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
              <div className="w-64 h-64 border-2 border-purple-200 rounded-full opacity-20 animate-spin" style={{ animationDuration: '20s' }}></div>
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-32 h-32 border-2 border-pink-200 rounded-full opacity-30 animate-spin" style={{ animationDuration: '15s', animationDirection: 'reverse' }}></div>
            </div>
          </div>

          {/* AI Chat Bubble */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            className="absolute top-20 left-1/2 transform -translate-x-1/2 max-w-md"
          >
            <div className="bg-white rounded-2xl p-4 shadow-lg border border-gray-200">
              <div className="flex items-start space-x-3">
                <div className="w-8 h-8 bg-gradient-to-br from-purple-500 to-pink-500 rounded-full flex items-center justify-center flex-shrink-0">
                  <Star className="h-4 w-4 text-white" />
                </div>
                <div className="flex-1">
                  <p className="text-gray-800 text-sm leading-relaxed">
                    Welcome to AI Video Studio! I can help you create amazing videos. Just describe what you want to see and I'll generate it for you. You can also edit and enhance your videos with simple prompts.
                  </p>
                </div>
              </div>
            </div>

            {/* Timestamp */}
            <div className="text-center mt-2">
              <span className="text-xs text-gray-500">12:21:44</span>
            </div>
          </motion.div>

          {/* Bottom Input Bar */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.5 }}
            className="absolute bottom-6 left-6 right-6"
          >
            <div className="bg-white rounded-2xl p-4 shadow-lg border border-gray-200">
              <div className="flex items-center space-x-4">
                {/* Model Selection */}
                <div className="flex items-center space-x-2">
                  <span className="text-sm text-gray-600">Model:</span>
                  <div className="relative">
                    <select
                      value={selectedModel}
                      onChange={(e) => setSelectedModel(e.target.value)}
                      className="appearance-none bg-white border border-gray-200 rounded-lg px-3 py-2 pr-8 text-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
                    >
                      <option value="Runway Gen-4 Turbo">Runway Gen-4 Turbo</option>
                      <option value="Runway Gen-3">Runway Gen-3</option>
                      <option value="Veo3">Veo3</option>
                    </select>
                    <ChevronDown className="absolute right-2 top-1/2 transform -translate-y-1/2 h-4 w-4 text-gray-400 pointer-events-none" />
                  </div>
                </div>

                {/* Input Field */}
                <div className="flex-1 relative">
                  <input
                    type="text"
                    placeholder="Describe the video you want to create..."
                    value={prompt}
                    onChange={(e) => setPrompt(e.target.value)}
                    onKeyPress={(e) => e.key === 'Enter' && handleSubmit(e)}
                    className="w-full px-4 py-2 pr-20 bg-gray-50 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent text-sm"
                    disabled={loading}
                  />

                  {/* Action Buttons */}
                  <div className="absolute right-2 top-1/2 transform -translate-y-1/2 flex items-center space-x-1">
                    <button className="p-1.5 text-gray-400 hover:text-gray-600 transition-colors">
                      <Paperclip className="h-4 w-4" />
                    </button>
                    <button
                      onClick={handleSubmit}
                      disabled={loading || !prompt.trim()}
                      className="p-1.5 bg-purple-600 text-white rounded-lg hover:bg-purple-700 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
                    >
                      <Send className="h-4 w-4" />
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        </motion.div>
      </div>

      {/* Lovable Banner */}
      <AnimatePresence>
        {showLovableBanner && (
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: 20 }}
            transition={{ duration: 0.3 }}
            className="absolute bottom-4 right-4"
          >
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default AIVideoStudio;
